function typeturaInit(t){function e(){t.forEach(t=>{t.style.setProperty("--tt-bind",t.offsetWidth/getComputedStyle(t).getPropertyValue("--tt-max")*-1+"s")})}e(),window.addEventListener("resize",e);var r=document.createElement("style");r.innerHTML=":root{--tt-ease:linear;--tt-max:1600}*,:before,:after,:root{--tt-key:none;animation:var(--tt-key) 1s var(--tt-ease) 1 var(--tt-bind) both paused}",document.head.insertBefore(r,document.head.firstChild)}document.onreadystatechange=(()=>{"complete"===document.readyState&&typeturaInit(document.querySelectorAll([":root",".typetura"]))});